import React, { Component } from 'react';
import { Stories } from 'react-insta-stories';

function MasterCarStories() {
  return (
    <div>
      <h1>Мои сторис</h1>
      <Stories
        stories={[
          { url: process.env.PUBLIC_URL + "/assets/giphy.gif" },
          { url: process.env.PUBLIC_URL + "/assets/giphy.gif" }
        ]}
        defaultInterval={1500}
		width={432}
		height={768}
      />
    </div>
  );
}

export default MasterCarStories;
